import React from "react";
import { Container, Content, Input, Button } from "../../Login_styles.js";

export default function Register(){
	return(
		<Container>
			<Content>
				<div>
					<label>Username </label>
					<input type="text" />
				</div>
				<div>
					<label>Password </label>
					<input type="password" />
				</div>
				<div>
					<a href="/">Cancel </a>
					<button type="submit"> Register </button>
					
				</div>
			</Content>
		</Container>
	);
}
